import React from "react";

const Video = ({ video, handleVote, handleRemove }) => {
  const handleVoteClick = (type) => {
    handleVote(video.id, type);
  };

  const handleDelete = () => {
    handleRemove(video.id);
  };

  return (
    <div className="video">
      <h3>{video.title}</h3>
      <iframe
        title={video.title}
        width="560"
        height="315"
        src={video.url}
        frameBorder="0"
        allowFullScreen
      ></iframe>
      <div className="video-controls">
        <button onClick={() => handleVoteClick("up")}>Up</button>
        <button onClick={() => handleVoteClick("down")}>Down</button>
        <button onClick={handleDelete}>Remove</button>
      </div>
    </div>
  );
};

export default Video;
